import minutesToDuration from "../../utils/duration";

export const checkMax = (num, max) => {
    if (num < max ) {
      return 1;
    } else {
      return 0;
    };
  };

export const checkMin = (num, min) => {
      if (num > min) {
          return 1;
      } else {
          return 0;
      };
  };
